import React, { useEffect } from "react";

function Home() {
  const options = [
    {
      label: "Select Calendar",
      value: "Select Calendar"
    },
    {
      label: "South Australia Calendar",
      value: "South Australia Calendar",
    },
    {
      label: "Victoria Calendar",
      value: "Victoria Calendar",
    },
    {
      label: "New South Wales Calendar",
      value: "New South Wales Calendar",
    },
  ];

  const calculateDate = () => {

  }
  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    console.log("Start fetching data...");
    await fetch("http://localhost:8080/api/calendars", {
      method: 'GET',
      headers: new Headers({
        'Content-Type': 'application/json'
      })
    })
      .then((response) => response.json())
      .then((responseJson) => {
        console.log(responseJson[0]);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const fetchData1 = () => {
    var request1 = new XMLHttpRequest(); 
    request1.open('GET', 'http://localhost:8080/api/calendars', true)
    request1.onload = function() {
      var data1 = JSON.parse(this.response)
      console.log(data1[0].calendarCode)
    }
    request1.send()
  }


  return (
    <div class="tabContainer">
      <div class="pageTitle"> Calculate the commit date</div>
      <div class="infoText">Calculate the expected commit date based on the lead time in days</div>
      <table class="tableStyle">
        <tr class="rowContainer">
          <td><label>Select a calendar to use:</label></td>
          <td>
            <select name="calendar" id="calendar">
              {
                options.map((option) => (
                  <option value={option.value}>{option.label}</option>
                ))
              }
            </select>
          </td>
        </tr>
        <tr class="rowContainer">
          <td>
            <label>Enter the lead time in days: </label>
          </td>
          <td>
            <input id="inputText" type="text"></input>
          </td>
        </tr>
        <tr class="rowContainer">
          <td>
            <label>Exclude Weekend in Calculation </label>
          </td>
          <td>
            <input type="checkbox"></input>
          </td>
        </tr>
        <tr class="rowContainer">
          <td>
            <label>Exclude Holiday in Calculation </label>
          </td>
          <td>
            <input type="checkbox"></input>
          </td>
        </tr>
      </table>
      <input id="calculateButton" type="button" value="Calculate commit date" onClick={() => calculateDate()}></input>
    </div>

  );
}

export default Home;
